	getkenyaMapCoordinates() {
		return Promise.resolve(this.coordinates);
	}

	getkenyaCountiesMapCoordinates(customFills: any, fillCountyColor: string, strokeColor: string) {

		let myCoordinates: any[] = this.coordinates;

		for (let i = 0; i < myCoordinates.length; i++) {
			myCoordinates[i].strokeColor = strokeColor;
			myCoordinates[i].fillCountyColor = fillCountyColor;
			myCoordinates[i].customData = null;
		}

		for (let i = 0; i < customFills.length; i++) {
			let customFillCounty = "county_" + customFills[i].countyID;
			for (let i = 0; i < myCoordinates.length; i++) {
				if (customFillCounty === myCoordinates[i].id) {
					myCoordinates[i].strokeColor = customFills[i].strokeColor;
					myCoordinates[i].fillCountyColor = customFills[i].fillCountyColor;
					myCoordinates[i].customData = customFills[i].optionalTooltipData;
				}
			}
		}

		return Promise.resolve(myCoordinates);
	}

